import React from 'react'; 
import { Card } from 'primereact/card';

export default function BasicDemo() {
  const baseURL = "https://jsonplaceholder.typicode.com";
  useEffect(() => {
    axios
      .get(`${baseURL}/users`)
      .then((res) => {
        setChartData(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
    },[]);
    return (
        <div className="card">
            <Card title="Title">
                <p className="m-0">
  
                </p>
            </Card>
        </div>
    )
}
